import React, { useEffect,useState } from "react";

function Products(){
    const [products,setProducts] = useState([])
    useEffect(  
    ()=>{fetch('https://fakestoreapi.com/products?limit=10')
            .then(res=>res.json())
            .then(json=>setProducts(json))}
    ,[])
    return(
        <div className="flex  flex-wrap gap-5 justify-evenly  h-full">

            {products.map((product)=>{
                console.log(product);
                return (<div className="text-center p-2 rounded-3xl text-xl ">
                    <img src={product.image} alt="" />
                    <div>
                    {product.title}
                    {product.price}
                    </div>
                    </div>
                )})}
        </div>
)}

export default Products
